import Artist from '../models/Artist';

export const findAllArtists = async (req, res) => {
    const artists = await Artist.find();
    res.json(artists);
};

export const createArtist = async (req, res) => {
    let id_encode = Buffer.from(req.body.Name, 'binary').toString('base64');
    if ( id_encode.length > 22)
    {
        id_encode = id_encode.slice(22);
    }
    const newArtist = new Artist({ 
        ID: id_encode,
        Name: req.body.Name,
        Age: req.body.Age,
        Albums: req.body.Albums,
        Tracks: req.body.Tracks,
        Self: req.body.Self
    });
    const artistSaved = await newArtist.save();
    console.log(newArtist);
    res.json("Saving new Artist");
};

